import React from "react";
import Income from "./Income";

const Posts = ({ posts, loading }) => {
  if (loading) {
    return <h2>Loading...</h2>;
  }
  console.log(posts);
  return (
    <ul className="list-group mb-4">
      {posts.map((post) => (
        <li key={post.id} className="list-group-item">
          {post.name}
          <br />
          {post.city}
          <Income id={post.id} />
        </li>
      ))}
    </ul>
  );
};

export default Posts;
